webpackJsonp([99301507405965],{1575:function(a,e){a.exports={data:{markdownRemark:{html:'<p>이른 아침 "가장 신비한 전쟁"을 읽는 것은 중국 군대와 버마 군대가 국민당의 잔당을 공동으로 공격했던 시대의 시작을 알렸다. 그러나 그는 글쓰기 스타일이별로 좋지 않다고 느꼈다. 글쓰기 스타일은 약간 은사스럽고 장엄했다. 그는 평원에서 마술을 보지 못했지만 의도적으로 편지를 썼다. 역사적인 사실은 가치가 있습니다.</p>\n<p>도입의 주제는 "93 중국 개발 보고서"에 대한 소개를 파악하는 것입니다. 전체 보고서와 동일합니다. 여섯 부분에서, 그것은 국제, 정치, 경제, 문화 및 사회에 해당합니다. 이 보고서를 쓰는 것은 중국 사회의 발전에 대한 더 깊은 이해를 제공해 왔으며 그 자료 또한 많은 것을 파악했습니다.</p>\n<p>돌아 오는 길에 모든 사람들이 토론에서 "왕자의 인용문"을 썼다면서 "장 지안은 토론을 요구하고 아이는 말을하지 않는다. 명상은 길고 나중에 : 신사는 마음에 대해 논쟁하며 악당은 자신의 입을 지킨다. 신사 토론 악당은이 말을 변호합니다. "</p>',id:"/home/swain/workspace/political-life/src/pages/ko/0022.md absPath of file >>> MarkdownRemark",fileAbsolutePath:"/home/swain/workspace/political-life/src/pages/ko/0022.md",frontmatter:{title:"2월 1일 화요일"}}},pathContext:{id:"/home/swain/workspace/political-life/src/pages/ko/0022.md absPath of file >>> MarkdownRemark"}}}});
